import Text from './Text';

function FormWithAnotheTitle({title, size, onSubmit}) {
    const initialInputValue = 'Test value';
    onSubmit('Submitted form data!');

    return (
        <div>
            {title}
            <Text inputSize={size} initial={initialInputValue}/>
        </div>
    );
}

export default FormWithAnotheTitle;
